import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import '../styles/Home.css'

function App() {
  return <div className="App">
    <Router>
      <Navbar />
      <Routes>
        <Route path = "/" element={<Home />} />
      </Routes>
    </Router>
  </div>;
}

export default App;
